/*Table structure for table `project` */

DROP TABLE IF EXISTS `project`;

CREATE TABLE `project` (
  `pid` int(11) NOT NULL AUTO_INCREMENT,
  `project_name` varchar(100) DEFAULT NULL,
  `project_desc` varchar(200) DEFAULT NULL COMMENT '项目描述',
  `add_time` int(11) DEFAULT NULL COMMENT '添加时间',
  `is_del` tinyint(4) DEFAULT '0' COMMENT '是否已删除。0否；1是',
  PRIMARY KEY (`pid`)
) ENGINE=InnoDB AUTO_INCREMENT=23 DEFAULT CHARSET=utf8;

/*Data for the table `project` */

insert  into `project`(`pid`,`project_name`,`project_desc`,`add_time`,`is_del`) values (1,'Discuz!','Crossday Discuz! Board（简称 Discuz!）是北京康盛新创科技有限责任公司推出的一套通用的社区论坛软件系统。',1379301310,0),(2,'dedecms','织梦内容管理系统(DedeCms) 以简单、实用、开源而闻名，是国内最知名的PHP开源网站管理系统，也是使用用户最多的PHP类CMS系统',1379301310,0),(3,'None','未知',1379301310,0),(4,'phpspy','PHPSPY是一个便捷管理服务器小软件，但多被用为木马后门',1379301310,0),(5,'ESPCMS','易思企业建站系统',1379990703,0),(6,'Joomla','Joomla是一个国外开源的CMS内容管理系统',1379990703,0),(7,'HDWiki','HDWiki开源的百科建站程序',1379990703,0),(8,'KingCMS','KingCMS 又一个开源的CMS内容发布系统',1379990703,0),(9,'PHPCMS','phpcms 又一个开源的CMS内容发布系统',1379990703,0),(10,'PhpMyadmin','PhpMyadmin是一个php语言编写的，管理mysql server的B/S工具',1379990703,0),(11,'PHPWind','PHPWind（简称：PW）是一个基于PHP和MySQL的论坛程序，也是较常用的论坛程序之一',1379990703,0),(12,'WeCenter','WeCenter原名Anwsion，是是一款知识型的社交化开源社区程序,专注于企业和行业社区内容的整理、归类、检索和再发行。 ',1379990703,0),(13,'Wordpress','Wordpress是一款世界上最流行的博客系统。',1379990703,0),(14,'cakephp','cakephp是世界上非常流行的一款PHP语言开发的框架',1380089183,0),(15,'CodeIgniter','CodeIgniter 是一个简单快速的PHP MVC 框架',1380089183,0),(16,'ECShop','ECShop是一款B2C独立网店系统，适合企业及个人快速构建个性化网上商店。系统是基于PHP语言及MYSQL数据库构架开发的跨平台开源程序。',1380089183,0),(17,'phpBB','phpBB是一个论坛软件，使用PHP语言开发的并开放其原始码。是模块化设计，具专业性、安全性高、支持多国语系、支持多种数据库和自定义的版面设计等优越性能，而且功能强大。',1380089183,0),(18,'ThinkPHP','ThinkPHP是一个开源的PHP框架，是为了简化企业级应用开发和敏捷WEB应用开发而诞生的。',1380089183,0),(19,'YiiFramework','Yii是一个基于组件、用于开发大型 Web 应用的 高性能 PHP 框架。Yii 几乎拥有了 所有的特性 ，包括 MVC、DAO/ActiveRecord、I18N/L10N、caching、基于 JQuery 的 AJAX 支持、用户认证和基于角色的访问控制、脚手架、输入验证、部件、事件、主题化以及 Web 服务等等。',1380089183,0),(20,'ZendFramework','ZendFramework(ZF)是Zend公司推出的一套PHP开发框架。是用PHP5来开发web程序和服务的开源框架。ZF用100%面向对象编码实现。',1380089183,0),(21,'Spider PHP Shell','Spider PHP Shell一款非常流行的PHP后门软件(我也不知道作者是谁)',1380191305,0),(22,'WebShell','其他比较流行的php 后门系统',1380259664,0);

/*Table structure for table `tokens` */

