/*Table structure for table `tokens_version` */

DROP TABLE IF EXISTS `tokens_version`;

CREATE TABLE `tokens_version` (
  `tid` char(32) NOT NULL COMMENT 'token id',
  `vid` int(11) NOT NULL COMMENT 'version id',
  `pid` int(11) NOT NULL COMMENT 'project id',
  `add_time` int(11) DEFAULT NULL COMMENT '添加时间',
  `path` varchar(300) DEFAULT NULL COMMENT '文件所在路径',
  `status` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT 'token所属安全状态，0为未知；1为安全；2为危险',
  `is_del` tinyint(4) DEFAULT '0' COMMENT '是否已删除。',
  `line` varchar(300) DEFAULT '0' COMMENT '所在行数，以半角的逗号分割',
  KEY `tid` (`tid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `tokens_version` */

